backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    encrypt = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block = var.vpc_cidr
  tags = {
    Name = var.vpc_name
  }
}

resource "aws_subnet" "public" {
  count             = length(var.public_subnets)
  vpc_id            = aws_vpc.main.id
  cidr_block        = element(var.public_subnets, count.index)
  availability_zone = element(var.azs, count.index)
  map_public_ip_on_launch = true

  tags = {
    Name = "${var.vpc_name}-public-${count.index}"
  }
}

resource "aws_subnet" "private" {
  count             = length(var.private_subnets)
  vpc_id            = aws_vpc.main.id
  cidr_block        = element(var.private_subnets, count.index)
  availability_zone = element(var.azs, count.index)
  map_public_ip_on_launch = false

  tags = {
    Name = "${var.vpc_name}-private-${count.index}"
  }
}

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "${var.vpc_name}-igw"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }

  tags = {
    Name = "${var.vpc_name}-public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(var.public_subnets)
  subnet_id      = element(aws_subnet.public.*.id, count.index)
  route_table_id = aws_route_table.public.id
}

# Additional resources such as NAT Gateways for private subnets can be added as required.

./module/vpc/variables.tf.code:
variable "vpc_name" {
  description = "The name of the VPC"
  type        = string
}

variable "vpc_cidr" {
  description = "The CIDR block for the VPC"
  type        = string
}

variable "azs" {
  description = "The availability zones in the region"
  type        = list(string)
}

variable "private_subnets" {
  description = "The list of private subnet CIDR blocks"
  type        = list(string)
}

variable "public_subnets" {
  description = "The list of public subnet CIDR blocks"
  type        = list(string)
}

variable "tags" {
  description = "The tags to apply to resources"
  type        = map(string)
}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC"
  value       = module.vpc.vpc_id
}

output "public_subnets_ids" {
  description = "The IDs of the public subnets"
  value       = module.vpc.public_subnets_ids
}

output "private_subnets_ids" {
  description = "The IDs of the private subnets"
  value       = module.vpc.private_subnets_ids
}

./module/ec2/main.tf.code:
# ...previous resources...

resource "aws_alb" "alb" {
  name               = "${var.application_name}-alb"
  subnets            = var.subnets
  security_groups    = [aws_security_group.alb_sg.id]
  internal           = false
  load_balancer_type = "application"

  tags = {
    Name = "${var.application_name}-alb"
  }
}

resource "aws_alb_target_group" "target_group" {
  name     = "${var.application_name}-tg"
  port     = 80
  protocol = "HTTP"
  vpc_id   = var.vpc_id

  health_check {
    interval            = 30
    path                = "/"
    timeout             = 5
    healthy_threshold   = 2
    unhealthy_threshold = 2
    matcher             = "200"
  }

  tags = {
    Name = "${var.application_name}-tg"
  }
}

resource "aws_alb_listener" "listener" {
  load_balancer_arn = aws_alb.alb.arn
  port              = 80
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.target_group.arn
  }
}

resource "aws_autoscaling_attachment" "asg_attachment" {
  autoscaling_group_name = aws_autoscaling_group.asg.id
  alb_target_group_arn   = aws_alb_target_group.target_group.arn
}

# User data script to set up a simple homepage with a message
resource "aws_launch_configuration" "launch_config" {
  # ...existing configuration...

  user_data = <<-EOF
              #!/bin/bash
              echo "Auto Deployment from Cloud-AI" > /var/www/html/index.html
              EOF

  lifecycle {
    create_before_destroy = true
  }
}

./module/ec2/variables.tf.code:
variable "application_name" {
  description = "The name of the application for tagging and naming resources"
  type        = string
}
variable "vpc_id" {
  description = "The VPC ID where resources will be deployed"
  type        = string
}
variable "ami_id" {
  description = "The AMI ID for the EC2 instances"
  type        = string
}
variable "instance_type" {
  description = "The type of EC2 instance to launch"
  type        = string
}
variable "subnets" {
  description = "The subnets for the ASG and ALB"
  type        = list(string)
}
variable "min_size" {
  description = "Minimum size of the Auto Scaling Group"
  type        = number
}
variable "max_size" {
  description = "Maximum size of the Auto Scaling Group"
  type        = number
}
variable "desired_capacity" {
  description = "Desired capacity of the Auto Scaling Group"
  type        = number
}
variable "user_data" {
  description = "The user data script to initialize the EC2 instances"
  type        = string
  default     = "#!/bin/bash\necho \"Auto Deployment from Cloud-AI\" > index.html"
}
variable "vpc_cidr" {
  description = "The CIDR block of the VPC"
  type        = string
}

./module/ec2/outputs.tf.code:
output "alb_dns_name" {
  description = "The DNS name of the ALB for accessing the application"
  value       = aws_alb.alb.dns_name
}

output "asg_name" {
  description = "The name of the Auto Scaling Group"
  value       = aws_autoscaling_group.asg.id
}

./outputs.tf.code:
